// SPDX-License-Identifier: MIT OR LGPL-2.0-or-later
pragma solidity ^0.8.5;

import "./ERC20Token.sol";
import "./Operations.sol";
import "./Escrow.sol";
import "./Pausable.sol";
import "./Passengers.sol";


/**
 * @dev Contract module which provides a basic storage system.
 *
 * This module is used through inheritance. It will make available the escrow contract
 * addresses created, details, owners of the escrow contract and passengers on escrow contract documentations.
 */
contract Aeropaye is Passengers {
    using SafeMath for uint256;

    mapping(address => airlineFlights) internal flight;
    mapping(Escrow => uint256) internal claimedBookingFeeByAirline;
    mapping(Escrow => bool) internal claimedByAirline;

    //Events for Logic Contract
    event EscrowCreated(
        address indexed AirlineAddr,
        Escrow indexed EscrowContract
    );

    event CompletedEscrowFlight(
        address indexed AirlineAddr,
        Escrow indexed EscrowContract
    );

    event BurntAsset(
        address indexed OwnerAddr, 
        uint256 AssetID
        );

    event  BookingFeeClaimed(
        Escrow indexed _flightEscrow,  
        address indexed _airline, 
        uint256 escrowbalance,
        uint256 passengerCount,
        uint256 claimedBookingFee);

    //Structs for Logic Contract
    struct airlineFlights {
        Escrow[] flights; 
        }

    modifier airlineAuthorized(uint256 _escrowKey, Escrow _flightEscrow) {
        require( 
            flight[_msgSender()].flights[_escrowKey] == _flightEscrow
        );
        _;
    }

    modifier claimCheckAirline(address _airline, Escrow _flightEscrow){
        require(!claimedByAirline[_flightEscrow]
        );
        _;
    }

    constructor(address _tokenAddress, address _opAddress) Passengers( _tokenAddress,  _opAddress)
    {
        token = ERC20Token(_tokenAddress);
        operation = Operations(_opAddress);
    }

    //     ***********   SETTERS   ************

     /**
     * Creating Escrow Wallet for the Airline Flight
     * @param _airline Airline address
     * @param _flightCode Flight code
     * @param _flightDeparture Flight departure
     * @param _flightArrival Flight arrival
     * @param _flightTime Departure time of flight
     */
    function escrowCreation(
        address _airline,
        string memory _flightCode,
        string memory _flightDeparture, 
        string memory _flightArrival, 
        string memory _flightTime
    ) 
    public
    whenNotPaused
    returns (address) {
        require(operation.IsAirLineList(_airline));

        uint32[3] memory getRefunds = [ operation.GetRefunds(_airline).FLIGHT_REFUND, operation.GetRefunds(_airline).BOOKING_REFUND, operation.GetRefunds(_airline).FLIGHT_REFUND];

        Escrow escrowContract =
            new Escrow(
                _airline, 
                _flightCode, 
                _flightDeparture, 
                _flightArrival, 
                _flightTime, 
                uint32(FlightStatus(2)), 
                getRefunds[0],
                getRefunds[1],
                getRefunds[2]
                );

        flight[_airline].flights.push(escrowContract);
        operation.SetUserList(address(escrowContract));

        emit EscrowCreated(_airline, escrowContract);

        return address(escrowContract);
    }


    /**
     * Airline claim Booking fee
     */
    function airlineClaimBookingFee(
        Escrow _flightEscrow,
        uint32 _escrowKey
    )
    public
    airlineAuthorized(_escrowKey, _flightEscrow)
    returns (bool)
    {
        require(
            token.allowance(address(_flightEscrow), _msgSender()) != 0,
            "Airline does not have enough allowance to claim booking fee"
        );
        claimedBookingFeeByAirline[_flightEscrow] += 1;
        uint256 escrowbalance = token.balanceOf(address(_flightEscrow));
        uint256 passengerCount = passengerPaid[address(_flightEscrow)];
        uint256 claimedBookingFee = claimedBookingFeeByAirline[_flightEscrow];

        token.withdrawFromEscrow(address(_flightEscrow), _msgSender());


        emit BookingFeeClaimed(_flightEscrow,  _msgSender(), escrowbalance, passengerCount, claimedBookingFee);

    return true;
    }

     /**
     * Airline claim Flight fee
     */
    function airlineClaimFlightFee(
        Escrow _flightEscrow,
        uint32 _escrowKey
    )
    public
    airlineAuthorized(_escrowKey, _flightEscrow)
    claimCheckAirline(_msgSender(), _flightEscrow)
    returns (bool)
    {
        require(
            _flightEscrow.getAirline().FlightStatus == uint32(FlightStatus.COMPLETED),
            "Flight is not updated to completed"
        );

        //mark flight as claimed
        claimedByAirline[_flightEscrow] = true;

        token.withdrawFlightFee(address(_flightEscrow), _msgSender());

        return true;
    }

     /**
     * UpdateFlight Status by Airline to allow Airline claim payment
     * @param _flightEscrow Airline Flight Escrow address
     */
    function updateFlightStatus(
        Escrow _flightEscrow,
        uint32 _escrowKey,
        uint32 _flightStatus
    )
    public 
    airlineAuthorized(_escrowKey, _flightEscrow)
    returns (bool)
    { 
        //require flight is cancelled
        require(
            _flightEscrow.getAirline().FlightStatus != uint32(FlightStatus.COMPLETED),
            "Flight is already completed"
        );

        _flightEscrow.setAirline(_flightStatus);
        emit CompletedEscrowFlight(_msgSender(), _flightEscrow);
        return true;
    }



    //    ***********    Getters   ***********

    /**
     * Get Escrow contracts of Airline
     */
    function getFlightEscrows(
        address _airline
    )
    public
    view
    returns (Escrow[] memory){
        return flight[_airline].flights;
    }


}

